  [],\n\t\"revision_timestamp\": \"2016-07-15T04:23:31.707305\",\n\t\"name\": \"noncompliance-in-the-use-of-cardiovascular-medications\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Non-compliance was found to be lower
  than previously reported. Patients who are male, age 65 to 74, Black, or residing
  in the South are associated with higher noncompliance for cardiovascular medications
  among the therapeutic classes we studied. Dual eligibility enrollment is typically
  associated with improved compliance, enrollment in a Medicare Advantage Prescription
  Drug (MAPD) plan may or may not improve compliance dependent on the therapeutic
  class under study. Increased disease burden is associated with lower compliance.
  OOP non-class costs had an opposing effect on compliance as compared to OOP daily
  costs, higher OOP non-class costs were associated with better compliance.</p>n\",\n\t\"license_title\":
